import React from 'react';
import { Route, Switch } from 'react-router-dom';

export const GuestRoute = ({ component: Component, ...rest }) => {
  return (
    <Switch>
      <Route {...rest} render={props => <Component {...props} />} />
    </Switch>
  );
};
